import React from 'react'

export default class Identification extends React.Component {
    render() {
        return (
        <fieldset>
            <legend>Legenda</legend>
            <label>Login</label>
            <input type="text"></input>
            <label>Password</label>
            <input type="password"></input>    
        </fieldset>);
    }
}
